//Credit: https://kyrise.itch.io/kyrises-free-16x16-rpg-icon-pack
import MpPotionImg from './mp-potion.png';

const MpPotion = {
    name: 'Mana Potion',
    type: 'potion',
    kind: 'mana',
    mp: 20,
    mpReset: 20,
    image: MpPotionImg,
    value: 40,
};

export default MpPotion;
